'use client'
import { useState } from 'react'
import { User } from './page'

type Props = {
    users:User[]
}

const UserListClient = ({users}: Props) => {
    const [isModalOpen, setIsModalOpen] = useState(false)
  return (
    <div>
        <ul>
        {users.map((u) => (
          <li key={u.id}>
            {u.firstName}
          </li>
        ))}
      </ul>
    </div>
  )
}

export default UserListClient
